import React from 'react';
import Table from 'react-bootstrap/Table'


function Adminlist1 (props)  {

    return (   
                
                // <div className="item col-md-5 col-sm-10" style={{alignContent:'center', border:'solid', marginRight:'2%', marginTop:'2%', paddingTop:'3%', borderRadius:'10px', backgroundColor:'white'}}>
                //     <p><b>ID : {props._id}</b></p>
                //     <p><b>Item Name : {props.itemId}</b></p>
                //     <p><b>Catogary Name : {props.catogaryName}</b></p>
                //     <p><b>Subcatogary Name : {props.subcategaryName}</b></p>
                //     <p><b>Price : {props.price}</b></p>
                // </div>  

                <div >
                    <Table style={{textAlign:'center'}}>
                            <thead>
                                <tr style={{width:'100%'}}>
                                <th style={{width:'20%'}}>Item Id</th>
                                <th style={{width:'20%'}}>Item Name</th>
                                <th style={{width:'20%'}}>catogaryName</th>
                                <th style={{width:'20%'}}>SubcatogaryName</th>
                                <th style={{width:'20%'}}>Price</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr style={{width:'100%'}}>
                                <td style={{width:'20%'}}>{props._id}</td>
                                <td style={{width:'20%'}}>{props.itemId}</td>
                                <td style={{width:'20%'}}>{props.catogaryName}</td>
                                <td style={{width:'20%'}}>{props.subcategaryName}</td>
                                <td style={{width:'20%'}}>{props.price}</td>
                                </tr>
                            </tbody>
                        </Table>
                </div>

    )   
    
    }

export default Adminlist1;
